  [],\n\t\"revision_timestamp\": \"2016-07-27T22:23:26.278979\",\n\t\"name\": \"charles-m-russell-ul-bend-nwr-report-on-wilderness-character-monitoring\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This report discusses 43 possible wilderness
  character monitoring measures for Charles M. Russell and UL Bend National Wildlife
  Refuges. In 2011, measures were developed for Charles M. Russell and UL Bend NWR
  during a six-month assessment guided by a Wilderness Fellow. The measures developed
  emphasize important game species: bighorn sheep, elk, mule deer, and grouse, as
  well as important wildlife species in decline such as black-tailed prairie dogs
  and black-footed ferrets. The measures do not, however, specifically emphasize the
  refugeu2019s trust species: sharp-tailed grouse and pronghorn antelope. Another
  emphasis of the measures developed is the scattered nature of wilderness areas across
  the refuge.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\": [{\n\t\t\"key\":
